import Link from "next/link"
import Head from "next/head"
import logo from "../assets/exam.png"
export default ({loggedIn, accountName, userID}) => (
    <div className="main">
        <Head>
            <link href="https://fonts.googleapis.com/icon?family=Material+Icons" rel="stylesheet" />
        </Head>
        <div style={{display: "flex", width: "24px"}}>
            <Link href="/upload">
                <a style={{display: "flex"}}>
                    <i class="material-icons">file_upload</i>
                </a>
            </Link>
        </div>

            {
                loggedIn ? <Link href={`/user/${userID}`}><a className="account">{accountName}</a></Link> : 
                <div className="account">
                    <Link href="/login"><a>Login</a></Link> <Link href="/signup"><a>Sign up</a></Link>
                </div>
            }

    <style jsx>{`
        .main {
            display: flex;
            flex-direction: column;
            justify-content: center;
            align_items: flex-end;
            height: 4rem;
            background: rgb(0,0,0);
        }

        .account {
            align-self: flex-end;
            display: flex;
            width: 10rem;
            justify-content: space-around;
        }

        .logo {
            position: absolute;
            top: .65rem;
            left: .5rem;
            width: 32px;
            height: 32px
        }

        a {
            text-decoration: none;
            color: rgb(255,255,255);
            font-size: 1.3rem;
        }

        a:hover {
            color: rgb(222, 218, 217);
        }


    `}</style>
    </div>
)
